

CREATE TABLE `cars` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `car_id` mediumint,
  `model` varchar(255) default NULL,
  `year` varchar(255) default NULL,
  `cargo` varchar(255) default NULL,
  `range` varchar(255) default NULL,
  `version` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

